import React from 'react';

function HeaderComponent() {

    return (
        <div className="HeaderComponent">
        <Link to="first" style={{ textDecoration: 'none' }}>
            <MenuItem style={{ paddingLeft: 13 }}>Team 1</MenuItem>
            </Link>
        </div>
    )
}

export default HeaderComponent;
